import React, { Component } from "react";
import { movies } from "./getMovies";
import "./Nomination.css";

export default class Favourite extends Component {
  constructor(props) {
    super(props);
    this.state = {
      genres: [],
      currgen: "All Genres",
    };
  }

  componentDidMount() {
    let genreids = {
      28: "Action",
      12: "Adventure",
      16: "Animation",
      35: "Comedy",
      80: "Crime",
      99: "Documentary",
      18: "Drama",
      10751: "Family",
      14: "Fantasy",
      36: "History",
      27: "Horror",
      10402: "Music",
      9648: "Mystery",
      10749: "Romance",
      878: "Sci-Fi",
      10770: "TV",
      53: "Thriller",
      10752: "War",
      37: "Western",
    };
    let data = JSON.parse(localStorage.getItem("movies_app") || "[]");
  }

  render() {
    const Movie = movies.results;
    console.log(Movie);

    let tempArr = [];
    Movie.forEach((movieObj) => {
      if (!tempArr.includes(genreids[movieObj.genre_ids[0]])) {
        tempArr.push(genreids[movieObj.genre_ids[0]]);
      }
    });
    tempArr.unshift("All Genres");
    // this.setState({
    //   genres:[...temp]
    // })
    console.log(tempArr);
    return (
      <div>
        <>
          <div className="main">
            <div className="row">
              <div className="col-3">
                <ul class="list-group nomination-genres">
                  {tempArr.map((genre) =>
                    this.state.currgen == genre ? (
                      <li className="list-group-item nomination_genre1">
                        {genre}
                      </li>
                    ) : (
                      <li className="list-group-item nomination_genre2">
                        {genre}
                      </li>
                    )
                  )}
                </ul>
              </div>
              <div className="col-9 nomination-table">
                <div className="row">
                  <input
                    type="text"
                    className="input-group-text col"
                    placeholder="Search"
                  />
                  <input
                    type="number"
                    className="input-group-text col"
                    placeholder="Rows Count"
                  />
                </div>
                <div className="row">
                  <table class="table table-hover">
                    <thead>
                      <tr>
                        <th scope="col">Title</th>
                        <th scope="col">Genre</th>
                        <th scope="col">Popularity</th>
                        <th scope="col">Rating</th>
                      </tr>
                    </thead>
                    <tbody>
                      {Movie.map((movieObj) => (
                        <tr>
                          <td>
                            <img
                              src={`https://www.themoviedb.org/t/p/w600_and_h900_bestv2${movieObj.backdrop_path}`}
                              alt={movieObj.title}
                              className="nomination-img"
                            />
                            {movieObj.original_title}
                          </td>
                          <td>{genreids[movieObj.genre_ids[0]]}</td>
                          <td>{movieObj.popularity}</td>
                          <td>{movieObj.vote_average}</td>
                          <button
                            type="button"
                            class="btn btn-light nomination-button"
                          >
                            <td>Delete</td>
                          </button>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>

                <div>
                  <nav aria-label="Page navigation example">
                    <ul class="pagination">
                      <li class="page-item">
                        <a class="page-link" href="#">
                          Previous
                        </a>
                      </li>
                      <li class="page-item">
                        <a class="page-link" href="#">
                          1
                        </a>
                      </li>
                      <li class="page-item">
                        <a class="page-link" href="#">
                          2
                        </a>
                      </li>
                      <li class="page-item">
                        <a class="page-link" href="#">
                          3
                        </a>
                      </li>
                      <li class="page-item">
                        <a class="page-link" href="#">
                          Next
                        </a>
                      </li>
                    </ul>
                  </nav>
                </div>
              </div>
            </div>
          </div>
        </>
      </div>
    );
  }
}
